The Secret Life of the Cat

Science Documentary hosted by Kelly Hunter, published by BBC broadcasted as part of BBC Horizon series in 2013 - English narration


Information
------------------------------

Horizon discovers what your cat really gets up to when it leaves the cat flap. In a groundbreaking experiment, 50 cats from a village in Surrey are tagged with GPS collars and their every movement is recorded, day and night, as they hunt in our backyards and patrol the garden fences and hedgerows. Cats are fitted with specially developed cat-cams which reveal their unique view of our world.

